import React, { Component } from 'react';

class Navbar extends Component {
    render() {
        return (
            <header>
                <nav>
                    <div>
                        <ul>
                            <li><a href='/'>Search 1</a></li>
                            <li><a href='/'>Search 2</a></li>
                        </ul>
                    </div>
                </nav>
            </header>
        );
    }
}

export default Navbar;
